import { useState } from "react"
import React from "react"

export default function Cart({cart, deleteHouse}) {
    
    return(
        <div className='sale_container'>
            {cart.map((e)=> {
                return(<>
                    <div className="box" key={e.id}>
                        <div className="img-box">
                            <img src={e.img} alt=""/>
                        </div>
                        <div className="detail-box">
                            <h6>{e.name}</h6>
                            <button className="plus" onClick={()=> delet}>-</button>
                            <p>{e.opisanie}</p>
                        </div>
                    </div>
                </>)
            })}
         
        </div>
    )
}
